<script>
	export default {
		emits: ['darkmode', 'logout'],
		props: {
			image: {
				type: String,
				default: 'data:image/jpeg;base64,'
			},
			breakpoint: {
				type: Number,
				default: 568
			},
			dark: {
				type: Boolean,
				default: false
			},
			color: {
				type: String,
				default: 'rgba(14, 58, 62, 1)'
			},
			background: {
				type: String,
				default: 'rgba(240,240,240,1)'
			},
			hover: {
				type: String,
				default: 'rgba(220,220,220,1)'
			},
			border: {
				type: String,
				default: 'rgba(251,178,60,1)'
			},
			colorDark: {
				type: String,
				default: 'rgba(240,240,240,1)'
			},
			backgroundDark: {
				type: String,
				default: 'rgba(75,75,75,1)'
			},
			hoverDark: {
				type: String,
				default: 'rgba(50,50,50,1)'
			},
			borderDark: {
				type: String,
				default: 'rgba(130,130,130,1)'
			}
		},
		data: () => ({
			open: false,
			mobile: false,
			forceDark: false
		}),
		computed: {
			darkmode() {
				return this.dark || this.forceDark
			}
		},
		watch: {
			open(isOpen) {
				if (isOpen) {
					document.body.classList.add('vp-hide-scroll')
				} else {
					document.body.classList.remove('vp-hide-scroll')
				}
			},
			forceDark(darkmode) {
				this.$emit('darkmode', darkmode)
			}
		},
		created() {
			this.onResize()
			window.addEventListener('resize', this.onResize)
		},
		beforeDestroy() {
			window.removeEventListener('resize', this.onResize)
		},
		methods: {
			onResize() {
				this.mobile = window.innerWidth < this.breakpoint
			}
		}
	};

</script>

